pragma solidity ^0.5;

import "./SimpleTokenSale.sol";
import "./IPancakeRouter.sol";


// @TODO: Inherit the crowdsale contracts
contract LiquidityBackedTokenSale is SimpleTokenSale {
  using SafeMath for uint256;
  IPancakeRouter02  public router;
  uint256 liquidityTokens;
  uint256 liquidityEth;
  uint256 shouldBurn;
  constructor(
    uint rate, // rate in TKNbits
    IERC20 token, // token
    address payable wallet, // company's fundraising wallet that holds ETH sent from users
    uint256 softCap, // goal of the crowdsale
    uint256 hardCap,
    uint256 _liquidityTokens,
    uint256 _liquidityEth,
    uint256 _openingTime, // testing: uint fakenow
    uint256 closingTime, // testing: closingTime = fakenow + 2 minutes
    IPancakeRouter02 pancakeRouter,
    bool _shouldBurn
  ) public SimpleTokenSale(rate, token, wallet, softCap, hardCap, _openingTime, closingTime,_shouldBurn)
  {
    router = pancakeRouter;
    liquidityTokens=_liquidityTokens;
    liquidityEth=_liquidityEth;

  }

  function info() public view returns(uint256,uint256,uint256,uint256,uint256,uint256,uint256,address,address){
    return (rate(),goal(),cap(),liquidityTokens,liquidityEth,openingTime(),closingTime(),address(token()),wallet());
  }
  function status()public view returns (uint256,uint256,uint256,uint256,bool,bool,bool){
      return (weiRaised(),token().balanceOf(address(this)),balanceOf(msg.sender),lockedEthers[msg.sender],isOpen(),hasClosed(),finalized());
  }

  function approve()public{
    token().approve(address(router), liquidityTokens);
  }
  function addLiquidity() public{
    router.addLiquidityETH.value(liquidityEth)(
      address(token()), // tokenAddress
      liquidityTokens, // token to add in liquidityPool
      liquidityTokens.div(20), // tokenAmount min
      liquidityEth.div(20), // etheramount min
      address(this), // liquidity beneficiary
      block.timestamp         // deadline is right on this block.
    );

  }

  function _finalization() internal {
    token().approve(address(router), liquidityTokens);
    if(capReached()){
      router.addLiquidityETH.value(liquidityEth)(
        address(token()), // tokenAddress
        liquidityTokens, // token to add in liquidityPool
        liquidityTokens.div(20), // tokenAmount min
        liquidityEth.div(20), // etheramount min
        address(this), // liquidity beneficiary
        block.timestamp         // deadline is right on this block.
      );
    }
    super._finalization();
  }

}
